# Karanay, Republic of Bashkortostan

}}
Karanay (; , Qaranay) is a rural locality (a village) in Kanly-Turkeyevsky Selsoviet, Buzdyaksky District, Bashkortostan, Russia. The population was 14 as of 2010. There is 1 street.
Geography
Karanay is located 33 km southwest of Buzdyak (the district's administrative centre) by road. Novosemenkino is the nearest rural locality.
